import ExpenseItem from './ExpenseItem'

import './ExpenseList.css'

export default function ExpenseList(props){
    let expContent

    {props.items.length === 0 ? expContent= <p id='id1'>No expenses Found!</p> : expContent= props.items.map((exp) => (
      <ExpenseItem
       key={exp.id}
       title= {exp.title}
       amount={exp.amount} 
       date={exp.date} 
       />
       ) )}

       return (
        {expContent}
    )
    }
